import React, { Component } from 'react';
import { Link } from 'react-router-dom';
class Home extends Component {
    render() {
        return (
            <div className="home-con">
                <div className="nav-bar">
                    <i class="fas fa-align-justify"></i>

                </div>

                <Link to="/">LogOut</Link>
            </div>
        );
    }
}

export default Home;
